import './App.css';
import Navbar from './Components/Navbar/Navbar';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
function App() {
  return (
    <div >
      <BrowserRouter>
    <Navbar/>
    <Routes>
      <Route path ='/' element></Route>
    </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
